actionConfiguration.body:
() => {
  let count = 0;
  for (let i = L_CALLBACKS.data.length - 1; i >= 0; i--) {
    if (L_CALLBACKS.data[i].REMARK == "RNR" || L_CALLBACKS.data[i].REMARK == "CALL BACK" && L_CALLBACKS.data[i].ACTIVE == true) {
      count = count + 1;
    }
  }
  return count;
}

